import './App.css';
import LoginForm from './components/LoginForm';
import Navigator from './components/Navigator';
import {Router, HashRouter} from "react-router-dom";

function App() {
  return (
    <div>
      <HashRouter>
        <Navigator/>
        <LoginForm/>
      </HashRouter>
    </div>
  );
}

export default App;
